#turns a 1d array into a box, 5x5x64
def oneToThree(v1):
    #initialization for the box size, 0 initialized 
    v = [[ [0 for col in range(64)] for col in range(5)] for row in range(5)]

    #iterates over loop 
    for i in range(5):
        for j in range(5):
            for k in range(64):
                v[i][j][k] = v1[64*(5*j+i)+k] #sets the ijk elt equal to its 1d counterpart 
    return v

#checks if two 3d arrays are equal, element by element
#true if equal, false otherwise
def eq3dArrays(a1,a2):
    for i in range(5):
        for j in range(5):
            for k in range(64):
                if a1[i][j][k] != a2[i][j][k]:
                    return False
    return True

#checks if two 1d arrays are equal, element by element
#true if equal, false otherwise
def eq2dArrays(a1,a2):
    for i in range(1600):
        if a1[i] != a2[i]:
            return False
    return True

