#used to calculate what will be added to ain based on the round number
def calculatebit(ain,r):
    #initial values of RC 
    rc = [1,0,0,0,0,0,0]
    #calculating the rest of RC
    for i in range(8,168):
        rc.append((rc[len(rc)-8]+rc[len(rc)-4]+rc[len(rc)-3] + rc[len(rc)-2])%2)
    return rc

#given round number and ain, will execute iota
def iota(ain, r):
    for l in range(7):
        rc = calculatebit(ain,r)
        ain[0][0][2**l- 1] = (ain[0][0][2**l - 1] + rc[(l + 7*r)%len(rc)])%2
    return ain

